import React from "react";
import { BrowserRouter, Switch, Route } from "react-router-dom";
import PlanetScreen from './screens/planets'

const Routes = () => {
    return(
    <BrowserRouter>
    <Switch>
        <Route exact path="/" component={PlanetScreen}/>
    </Switch>
    </BrowserRouter>
)
}
export default Routes;
